PART 3 The Rules of Engagement

During the summer of 2005, filmmaker Gordon Forbes spent three months embedded with the U.S. Marines 3rd Reconnaissance Battalion during their deployment to the Sunni Triangle in Iraq. He and his team documented the daily grind and struggles of the men in Alpha Company as they fought the War on Terror, thousands of miles away from home. While most networks send a crew to shoot only enough footage for a 90-second highlight piece, this three-part documentary covers several operations - from helicopter raids and mounted patrols to everyday interactions with the people of Iraq. Written by Gordon Forbes III
